import React from "react";
import { Link } from "react-router-dom";

function Tabs({ title, page, link }) {
  return (
    <Link
      to={`/${link}`}
      className={`tabs ${page === title ? "tab_border" : ""}`}
    >
      {title}
    </Link>
  );
}
export default function HomeLeft({ page }) {
  return (
    <div className="home_left">
      <Tabs title="Feed" page={page} link="home" />
      <Tabs title="Chat" page={page} />
      <Tabs title="Followers" page={page} />
      <Tabs title="Following" page={page} />
      <Tabs title="Profile" page={page} />
    </div>
  );
}
